module.exports = "<div class=\"container py-4\">\n    <h1 class=\"page-title\">Privacy Policy</h1>\n\n    <p>Your privacy is important to us. At www.medullaproductions.com the services are provided by Medulla Productions & Consulting LLC. We are committed to protect and handle your privacy and information in the most transparent manner. This\n        statement lays out how we collect, manage, store and protect your personal data. Please read carefully this statement to get a clearer understanding about our privacy policy. By providing us with any personal information, you are consenting\n        to the\n        use of your personal information as contemplated in this privacy notice. If you do not agree to any part of this Policy, Please stop accessing the website and do not submit any of your personal information here.</p>\n\n\n    <p class=\"headline\">WHAT INFORMATION DO WE COLLECT</p>\n    <ul>\n        <li>\n            By using www.medullaproductions.com, the user acknowledges and understands that www.medullaproductions.com is an online platform that connects the emerging talent with the industry professionals. Industry Professionals i.e. Companies\n            or\n            freelancers\n            share their talent requirements through the administrator of the platform and in response to that requirement Medulla Productions provide them with the best matching talent out of its talent pool. The Talent categories include\n            Entertainment\n            Professionals such as Actors, Models, Singers, Dancers, Models, etc; Production Crew such as Photographers, Videographers, Directors, Makeup & Hair professionals, Wardrobe Stylists, etc ; Event Crew such as Promoters, Hostesses,\n            Ushers,\n            Emcees\n            etc;\n            Post-Production Crew such as Editors, Sound Design, Colourists & Retouchers, VFX Artists and the like. The platform is also open to individuals who would like to register as Mystery Shoppers. The user further acknowledges that before\n            using,\n            visiting,\n            registering and/or otherwise accessing www.medullaproductions.com, he/she has read the Terms of Use and hereby affirm that:\n        </li>\n        <li>\n            We also collect certain information (automatically) through the use of \"cookies\" and similar tracking technologies. Cookies are small data files that are stored on a user's computer or device at the request of a website to enable the\n            website to\n            recognize previous visitors and retain information such as user preferences and history. If you wish to block, erase, or be warned of cookies, please refer to your browser instructions or \"help screen\" to learn about these functions.\n            However, if your\n            browser is set to not accept cookies or if you reject a cookie, you will not be able to sign in to your user account or use certain parts of the Services.\n        </li>\n        <li>\n            We collect your Personal Data i.e. full name, email address, phone number, current address, photos and other media that you voluntarily provide us, when you register for Medulla Productions or create a talent profile.\n        </li>\n        <li>\n            We also collect Personal Data when you sign up for email newsletters or alerts on Medulla Productions. Personal Data may contain your name, email, contact information, your location, as well as other information you provide us.\n        </li>\n        <li>\n            We also collect billing information when processing payment for the purchase of our services and membership.\n        </li>\n        <li>\n            We collect and store data about you when you use and/or communicate with the website administration.\n        </li>\n        <li>\n            We may also obtain information about you through third party sources as permitted by applicable law, such as public databases, social media platforms, and marketing partners.\n        </li>\n    </ul>\n\n    <p class=\"headline\">USE OF INFORMATION</p>\n    <p>We use your information:</p>\n    <ul>\n        <li>\n            To create an account for you to use our platform and services.\n        </li>\n        <li>\n            To respond to your requests or to manage your user account.\n        </li>\n        <li>\n            To fulfill your requests, respond to your inquiries.\n        </li>\n        <li>\n            To match your data for the potential roles and jobs with the third parties advertising such roles and jobs.\n        </li>\n        <li>\n            To make your talent profile visible publicly and discoverable across the worldwide web.\n        </li>\n        <li>\n            To use the contents of your profile on the social media platforms of Medulla Productions for the marketing and promotional purposes.\n        </li>\n        <li>\n            To use it for analytics, reporting and marketing purpose.\n        </li>\n        <li>\n            To monitor the safety and security of our services and platform.\n        </li>\n        <li>\n            To use data and content about users for communications promoting membership, job posting, and engagement with us.\n        </li>\n        <li>\n            To assess the performance of advertisements displayed to our users directly by us or through third party advertising partners.\n        </li>\n    </ul>\n\n    <p class=\"headline\">YOUR RIGHTS IN RELATION TO YOUR INFORMATION</p>\n    <p>You have various rights in relation to your personal information as mentioned below:</p>\n    <ul>\n        <li>\n            To access your data.\n        </li>\n        <li>\n            To modify the data, you have provided to us at any time through your Medulla Productions profile.\n        </li>\n        <li>\n            To have your data rectified promptly if it is inaccurate or incomplete.\n        </li>\n        <li>\n            To have your data erased in specific circumstances.\n        </li>\n    </ul>\n\n\n    <p class=\"headline\">DATA RETENTION</p>\n    <p>We retain information for the maximum period allowable by law, where there is a reasonable business need or legitimate interest to retain such data and may store it on our server.</p>\n\n    <p class=\"headline\">CHILDREN</p>\n    <p>Our Services are not intended for use by children under the age of 18, and such use is prohibited by our Terms of Service. We do not knowingly collect Personal Information from children under 18. If you become aware that a child has provided\n        us with\n        Personal Information, please contact us as set forth in this Policy.</p>\n    <p>In case a user account has been created by the Guardian of a children under the age of 18, the person doing so must be the Parent or Legal Guardian of the children and, must affirm and consent to share the information of the children.</p>\n\n    <p class=\"headline\">THIRD-PARTY DISCLOSURE</p>\n    <p>We do not sell, trade, or make your personal data commercially available to any third party.\n        We may share information with our service providers for the completion of the assignment you have entrusted to us or unless such disclosure is required by law of the United Arab Emirates only.\n    </p>\n\n    <p class=\"headline\">ONLINE ADVERTISEMENT OF THIRD PARTY</p>\n    <p>We may also use third parties to display and target ads which might possess certain functionality (such as maps), or to place their own cookies and other tracking technologies to collect, track and analyse usage and statistical information\n        from\n        users. We are not responsible for the information collection practices of any third parties.\n    </p>\n\n    <p class=\"headline\">LINKS TO OTHER SITES</p>\n    <p>Our website, newsletters, email updates and other communications may, from time to time, contain links to and from the websites of others. The personal data that you provide through such websites is not subject to this privacy notice and the\n        treatment of your personal data by such websites is not the responsibility of www.Medulla Productions.com .</p>\n    <p>If you follow a link to any other websites, please note that these websites have their own privacy notices which will set out how your information is collected and processed when visiting those sites.</p>\n\n    <p class=\"headline\">HOW WE PROTECT YOUR DATA</p>\n    <p>We have implemented reasonable administrative, technical and physical measures to protect your personal information against loss, misuse and alteration.\n    </p>\n\n    <p class=\"headline\">SECURITY MEASURES</p>\n    <p>We endeavour to secure your Personal Information from our end, however, no security measures are perfect or impenetrable. To protect the confidentiality of your Personal Information is your responsibility. In case of any unauthorised use of\n        your\n        password, Medulla Productions is not responsible and you must advise us immediately by emailing us if you believe your password has been misused.\n    </p>\n\n    <p class=\"headline\">TRANSFERS OF INFORMATION</p>\n    <p>Information about our customers, including Personal Information, may be disclosed as part of any merger, acquisition, debt financing, sale of company assets, as well as in the event of an insolvency, bankruptcy or receivership in which\n        Personal\n        Information could be transferred to third parties as one of Medulla Productions business assets. In such an event, we will attempt to notify you before your Personal Information is transferred, but you may not have the right to opt out of any\n        such\n        transfer.\n    </p>\n\n    <p class=\"headline\">CHANGES TO THIS PRIVACY POLICY</p>\n    <p>This policy was last updated on 10/08/2020. We might change and update this policy from time to time by updating this page. We encourage you to check this page periodically to ensure that you are happy with any changes.</p>\n\n    <p class=\"headline\">POLICY QUESTIONS AND ENFORCEMENT</p>\n    <p>We are committed to protecting the privacy of your personal information. If you have questions or comments about our administration of your personal data or deactivate profile, please contact us at info@medullame.com or medullaprod@gmail.com\n    </p>\n</div>"

